import * as React from "react";
import iot_flaticon from "../../assets/svg/iot_flaticon.png";

function SvgComponent(props) {
  return (
    // <svg xmlns="https://thewebdev.tech/static/ce59ef6831a6ff9cba3b957baece8d8c/a3e81/logo.webp" width={27} height={40} viewBox="0 0 27 40" {...props}>
